import React from "react";
import "./app.css";
import Home from "./Home";
import {Route, Routes} from "react-router-dom";
import FlashCardApp from "./FlashCardApp";

function App() {
    return (
        <div className="App">
            <Route exact to="/" component={Home} />
            <Route exact to="/flash" component={FlashCardApp} />

        </div>
    );
}

export default App;
